export const LawIcon = () => {
  return <img src="/law-icon.png" alt="law image" />;
};
export const MenuIcon = () => {
  return <img src="/menu-icon.svg" alt="law image" />;
};
export const Minerva = () => {
  return <img src="/minerva-header.svg" alt="law image" />;
};
